// Loop over input items and add a new field called 'full name NEW' with fixed formatting
for (const item of $input.all()) {
  // Check if the "full name" field exists
  if (item.json["full name"]) {
    // Remove the comma and any extra spaces between first name and last name
    item.json["full name NEW"] = item.json["full name"].replace(/,\s*/g, " ").trim();
  } else {
    // If "full name" doesn't exist, create it from firstName and lastName
    if (item.json.firstName && item.json.lastName) {
      item.json["full name NEW"] = `${item.json.firstName} ${item.json.lastName}`;
    } else {
      item.json["full name NEW"] = "";
    }
  }
}
return $input.all();

